import { Fragment } from "react";
import styled from "styled-components";

export const Main = () => {
  return (
    <MainWrapper>
      <div>환영합니다</div>
      <div>
        <span>Find your movies !</span>
        <div>
          <input type="text" />
          <button type="button">검색</button>
        </div>
      </div>
    </MainWrapper>
  );
};

export const MainWrapper = styled.div`
  display: flex;
  flex-direction: column;
`;
